window.bookSummaryJSON = "<p><b>Their Cruise Ship Jumped to the Wrong Star System&nbsp;</b></p> <p>The <i>USA Today</i> best-selling author of <i>Dark Space</i>, a true master of plot twists, brings you a gripping new sci-fi thriller....</p> <p>Criminal attorney Liam Price can't believe his luck. He scored a deal for a suite aboard the <i>Starlit Dream</i> to the exotic world of Aquaria in the Kepler star system. He surprises his wife, Aria, with the trip for her 40th birthday, and the Price family gets ready for the trip of a lifetime.&nbsp;</p> <p>Soon after the voyage starts, they learn that they’ve somehow jumped to the wrong star system. Liam consults the ship’s computer to determine their location, but he can't access the navigational data. The captain claims that there’s nothing to worry about, but Liam wonders: if there’s nothing to worry about, why restrict access to the ship’s nav data? He fears that pirates may have detoured them to rob and ransom the wealthy passengers.&nbsp;</p> <p>Before they can learn more, the ship plunges into darkness, and suddenly the cruise of a lifetime turns into a trip to hell. As the crisis unfolds, Liam and his family are thrust into the middle of a deadly conspiracy and a desperate struggle for survival.&nbsp;</p> <p><i>Into the Unknown</i> is a mystery thriller set in space, perfect for fans of Michael Crichton, Suzanne Collins, and Arthur C. Clarke.</p>"; 
